import './input.css';

function Input() {
  return (
    <div className="input">
        <label className="input__control_label" htmlFor="inputGroup">{props.label}</label>
        <div className="input__input_group">
          <input type="text" className="input_group__text" placeholder={props.placeholder} value={props.value}/>
          <span className="input_group__icon">
            <svg viewBox="0 0 16 16" fill="none" stroke={props.stroke} xmlns="http://www.w3.org/2000/svg">
              <path d={props.path} fill="none" />
            </svg>
          </span>
        </div>
    </div>
  );
}

export default Input;
